import React from "react";

import "./Navbar.css";

const Navbar = () => {
  return (
    <nav className="navbar">
      <div>
        <link>
          <h1>MovieFinder</h1>
        </link>
      </div>
      <div>
        <ul className="nav_links">
          <li>
            <a href="#">Home</a>
          </li>
          <li>
            <a href="#">My Movies</a>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
